import React, {Component} from 'react';
import TrackingProductItem from './TrackingProductItem';


class TrackingProduct extends Component{
    render(){
        return(
            <section className="tracking_product_area sec_pad">
                <div className="container">
                    <TrackingProductItem 
                        itemClass="tracking_pr_two" 
                        rowclass="flex-row-reverse"  
                        DevOpsTitle="Continuous Integration"  
                        DevOpsd="Continuous integration is a software development practice where developers regularly merge their code changes into a central repository, after which automated builds and tests are run. The key goals of continuous integration are to find and address bugs quicker, improve software quality, and reduce the time it takes to validate and release new software updates." 
                        DevOpsTitle2="Continuous Delivery"  
                        DevOpsd2="Continuous delivery is a software development practice where code changes are automatically built, tested, and prepared for a release to production. It expands upon continuous integration by deploying all code changes to a testing environment and/or a production environment after the build stage." 
                        />
                </div>
            </section>
        )
    }
}

export default TrackingProduct;
